video_description:
A special roundtable edition of Bret Weinstein's DarkHorse podcast.


Glenn C. Loury is Merton P. Stoltz Professor of Economics at Brown University. He holds the B.A. in Mathematics (Northwestern) and the Ph.D. in Economics (M.I.T). As an economic theorist he has published widely and lectured throughout the world on his research. He is also among America‚Äôs leading critics writing on racial inequality. He has been elected as a Distinguished Fellow of the American Economics Association, as a member of the American Philosophical Society and of the U.S. Council on Foreign relations, and as a Fellow of the Econometric Society and of the American Academy of Arts and Sciences. 
@GlennLoury on Twitter

After spending a year as a Bartley fellow at the Wall Street Journal, Chlo√© Valdary developed The Theory of Enchantment, an innovative framework for social emotional learning (SEL), character development, and interpersonal growth that uses pop culture as an educational tool in the classroom and beyond.  Chlo√© has trained around the world, including in South Africa, The Netherlands, Germany, and Israel. Her clients have included high school and college students, government agencies, business teams, + many more. She has also lectured in universities across America, including Harvard and Georgetown. Her work has been covered in Psychology Today Magazine and her writings have appeared in the New York Times and the Wall St Journal.
@cvaldary on Twitter

Kmele Foster is a co-founder at Freethink and serves as a lead Producer. His projects have included shows about the intersection of culture and revolution ("Pop Revolution"), fractious political debates (‚ÄúCrossing the Divide‚Äù), and world-changing innovation (‚ÄúChallengers,‚Äù ‚Äú Super Human"). Kmele is a regular contributor to various national outlets and co-hosts a syndicated media commentary podcast, The Fifth Column. In addition to his work in media and commentary, Kmele has previously helmed ventures in the technology, communications, and consumer goods industries.
@kmele on Twitter

Thomas Chatterton Williams is the author of Losing My Cool and Self-Portrait in Black and White. He is a contributing writer at the New York Times Magazine, a contributing editor at the American Scholar and a 2019 New America Fellow. His work has appeared in the New Yorker, the London Review of Books, Harper‚Äôs and elsewhere, and has been collected in The Best American Essays and The Best American Travel Writing. He has received support from Yaddo, MacDowell and The American Academy in Berlin. He lives in Paris with his wife and children.
@thomaschattwill on Twitter

John Wood Jr. is a national leader for Braver Angels, a former nominee for congress, former Vice-Chairman of the Republican Party of Los Angeles County, musical artist and a noted writer and speaker on subjects including racial and political reconciliation.
@JohnRWoodJr on Twitter

John McWhorter is a contributing writer at The Atlantic. He is a professor of linguistics at Columbia University, hosts the podcast Lexicon Valley, and is the author, most recently, of Words on the Move. 
@JohnHMcWhorter on Twitter 

Coleman Hughes is a fellow at the Manhattan Institute and a contributing editor at City Journal, where his writing focuses on race, public policy, and applied ethics. Coleman‚Äôs writing has been featured in the New York Times, the Wall Street Journal, National Review, Quillette, The City Journal and The Spectator. He has appeared on many podcasts, including The Rubin Report, Making Sense with Sam Harris, and The Glenn Show.
@coldxman on Twitter 


